import style from "../Courses.module.css";

function coursesPersonal(props) {
  console.log(props);
  if (props.personalCourse !== "") {
    return (
      <div className={style.container}>
        <div className={style.personalTitle}>
          {props.personalCourse.courseName}
        </div>
        <div className={style.personalStep}>
          <div>
            {props.personalCourse.steps.map((p) => (
              <div>{p.id + 1}</div>
            ))}
          </div>
          <div>
            {props.personalCourse.steps.map((p) => (
              <div key={p.id}>
                <div>{p.stepTitle}</div>
                <div>{p.stepType}</div>
                <div>{p.stepContent}</div>
              </div>
            ))}
          </div>
        </div>
      </div>
    );
  }
  return <div>Sorry, but smth went wrong</div>;
}
export default coursesPersonal;
